  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'rickymorty';
  }



<div class="menu">
    <div>
        <button routerLink="/">Inicio</button>
    </div>
